import React from 'react';
import { Link } from 'react-router-dom';

function HomePage() {
  return (
    <div>
      <h1>Welcome to the Home Page!</h1>
      <p>
        <Link to="/about">Go to About Page</Link>
      </p>
      <p>
        <Link to="/contact">Contact Us</Link>
      </p>
    </div>
  );
}

export default HomePage;
